def traverse_upper_halfplane(n):
    points = [(0, 0)]
    arch = 1
    sign = 1
    while len(points) < n:
        for y in range(arch+1):
            points.append((sign*arch, y))
        for x in range(arch-1, -arch-1, -1):
            points.append((sign*x, arch))
        for y in range(arch-1, -1, -1):
            points.append((-sign*arch, y))
        arch += 1
        sign = - sign
    return points[:n]
